import React from "react";
import Navbar from "./navbar";
import "./products.css"


function ViewProducts(){
    return(
        <>
        <div id="product-image">
        </div>
        <div id="product-desc">
        </div>
        </>

    )
}



export default function Products(){
    return(
        <div>
            <Navbar />
            <ViewProducts />

        </div>
    )
}
